import React from 'react';
import './style.css';
import logo from '../assets/imagens/logotipo.png';
import { parseJWT } from '../services/auth';
import { useHistory } from 'react-router-dom';

const Header = () =>{

  let history = useHistory();

  const sair = () => {
    localStorage.removeItem('Gcb-Caren-Token');
    history.push('/');
}

  const menu = () =>{

      if (parseJWT() == 1) {
      return(
      <div>
        <div className="header">
          <div className="ajuste">
          <a href={'/Panel'}><img className="logotipo" src={logo} alt="logotipo GCB Care"/></a>
          <h2>Seja Bem-vindo, nome do administrador</h2>
          </div>
        
          <div className="header-right">
          <a className="active" href="#home">Sair</a>
          </div>
        </div>
      </div>
    )
  }
  }
  return(
    <div>
      {
        menu()
      }
    </div>
  )

}

export default Header;
